#!/usr/bin/node
import { createClient, print } from 'redis';
// import { promisify } from 'util';

const client = createClient();

client.on("error", (err) => {
	console.log(`Redis client not connected to the server: ${err.message}`);
});

// older version of redis
client.on("connect", () => {
	console.log("Redis client connected to the server");
});


const hashKey = 'HolbertonSchools';

// Set multiple fields with redis.print for confirmation
client.hset(hashKey, 'Portland', 50);
client.hset(hashKey, 'Seattle', 80);
client.hset(hashKey, 'New York', 20);
client.hset(hashKey, 'Bogota', 20);
client.hset(hashKey, 'Cali', 40);
client.hset(hashKey, 'Paris', 2);

client.hgetall(hashKey, (err, value) => {
	if (!err)
		console.log(value);
})
